(1, 'Pertandingan Catur ', '<div>Pertandingan catur ini diadakan bertempat di...</div><div><br></div>', '2013-09-07', 'Aktiviti Sekolah', 'On', '[{"name":"files\\/women6_0qvyd5xz.png","usrName":"women6.png","size":23588,"type":"image\\/png","thumbnail":"files\\/thwomen6_dmkdblwc.png","thumbnail_type":"image\\/png","thumbnail_size":23588,"searchStr":"women6.png,!:sStrEnd"}]', NULL),
(2, 'Selesaikan masalah gambar attachment ', '<p class="MsoNormal">Sukacita dimaklumkan bahawa cuti dan aktiviti sekolah\r\nsebagaimana berikut;<o:p></o:p></p>\r\n\r\n<p class="MsoNormal" align="center" style="text-align:center"><o:p>&nbsp;</o:p></p>\r\n\r\n<table class="MsoTableGrid" border="1" cellspacing="0" cellpadding="0" style="border-collapse:collapse;border:none;mso-border-alt:solid windowtext .5pt;\r\n mso-yfti-tbllook:1184;mso-padding-alt:0in 5.4pt 0in 5.4pt">\r\n <tbody><tr>\r\n  <td width="396" valign="top" style="width:197.75pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt">\r\n  <p class="MsoNormal" style="margin-bottom: 0.0001pt;"><b><span style="font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt">Tarikh<o:p></o:p></span></b></p>\r\n  </td>\r\n  <td width="396" valign="top" style="width:2.75in;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n  solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt">\r\n  <p class="MsoNormal" style="margin-bottom: 0.0001pt;"><b><span style="font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt">Cuti<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width="396" valign="top" style="width:197.75pt;border:solid windowtext 1.0pt;\r\n  border-top:none;mso-border-top-alt:solid windowtext .5pt;mso-border-alt:solid windowtext .5pt;\r\n  padding:0in 5.4pt 0in 5.4pt">\r\n  <p class="MsoNormal" style="margin-bottom: 0.0001pt;">1 Mei 2015 (Jumaat)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></p>\r\n  </td>\r\n  <td width="396" valign="top" style="width:2.75in;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5