(7, 'Pertandingan Bola Antara Kelas', '<span style="font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;">Suspendisse feugiat porta est quis commodo. In hac habitasse platea dictumst. Sed ultrices lectus a nunc hendrerit gravida. Aenean rutrum nulla eu tellus suscipit posuere. Duis et elit eros. Sed congue mauris sed felis vulputate vulputate et quis enim. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Aliquam nec turpis erat. Mauris sed felis ac magna auctor dapibus. Integer ornare tempus leo, lacinia sollicitudin metus feugiat ac.</span>', '2014-04-02', 'Aktiviti Sekolah', 'On', '[{"name":"files\\/135383250_zp9dmkr0.jpg","usrName":"135383250.jpg","size":87718,"type":"image\\/jpeg","thumbnail":"files\\/th135383250_den556ij.jpg","thumbnail_type":"image\\/jpeg","thumbnail_size":4973,"searchStr":"135383250.jpg,!can-stock-photo_csp3600921.jpg,!:sStrEnd"},{"name":"files\\/can-stock-photo_csp3600921_l4r03nz9.jpg","usrName":"can-stock-photo_csp3600921.jpg","size":22192,"type":"image\\/jpeg","thumbnail":"files\\/thcan-stock-photo_csp3600921_1rvtpbda.jpg","thumbnail_type":"image\\/jpeg","thumbnail_size":5175}]', ''),
(12, 'Johan SAINS Nasional!!', '<span style="color: rgb(37, 37, 37); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 21px;">Sekolah Menengah Sains Sultan Mohamad Jiwa (SMSSMJ) ialah salah sebuah Sekolah Berasrama Penuh (SBP) di utara Malaysia. Sekolah ini terletak dibandar Sungai Petani, Kedah Darul Aman. Sekolah ini ditubuhkan pada 1973 sebagai Sekolah Menengah Sains Kedah sebelum ditukar nama sebagai Sekolah Sultan Mohamad Jiwa pada 1984. Perasmian nama baru ini telah dibuat oleh Duli Yang Maha Mulia Sultan Abdul Halim Muadzam Shah, Sultan Kedah. Nama ini seterusnya ditukar menjadi Sekolah Menengah Sains Sultan Mohamad Jiwa dan kekal sehingga sekarang. Pada 2013, Sekolah Menengah Sains Sultan Mohamad Jiwa memiliki 796 pelajar lelaki dan 786 pelajar perempuan, menjadikan jumlah keseluruhan murid seramai 1575 orang. Ia mempunyai seramai 126 orang guru.2009 Alumni sekolah ini dikenali sebagai ASSAK (Alumni Sains Kedah).</span>', NULL, 'Umum', 'On', '', '[{"name":"files\\/women2_j4ejeq70.png","usrName":"women2.png","size":25840,"type":"image\\/png","searchStr":"women2.png,!kursus_sekolah.pdf,!:sStrEnd"},{"name":"files\\/kursus_sekolah_wxyy0yl1.pdf","usrName":"kursus_sekolah.pdf","size":273013,"type":"application\\/pdf"}]'),
