"type":"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document"}]'),
(18, 'SEJARAH SEKOLAH', 'Sekolah Rendah Agama Kota Damansara atau lebih dikenali dengan nama SRAKD adalah sebuah sekolah yang mempunyai dua buah bangunan setinggi empat tingkat dan di lengkapi dengan prasana lain seperti surau, kantin, padang dan sebagainya.&nbsp;<div><br></div><div>Sekolah ini telah mula beroperasi sejak tahun 2007 lagi dengan bilangan murid seramai 1600 orang.Sejak dari itu, bilangan murid di sekolah ini semakin bertambah tahun demi tahun yang kini berjumlah 1800 orang murid. Dahulunya dinaungi oleh Ust. Mohd Fauzi B. Hj Bain, diikuti oleh Ust. Zaki B. Sudarman, dan Ust. Hj. Kamaludin B. Hj Sahlan.&nbsp;</div><div><br></div><div>Kini bahtera SRAKD dikemudi oleh Ustazah Masitah Bt. Hj. Khojali. Hari demi hari sekolah SRAKD dikenali oleh masyarakat setempat dengan melahirkan ramai murid yang telah berjaya menamatkan pengajian dengan jayanya di peringkat sekolah rendah. Dahulunya SRAKD hanyalah dua blok bangunan empat tingkat tanpa infrastruktur lain yang menceriakan keadaan sekolah.</div><div><br></div><div>Kini SRAKD telah dilengkapi dengan dua buah gelangang badminton, pondok istirehat murid, pentas utama, kolam ikan, kebun sayuran dan sebagainya yang menambahkan lagi keceriaan sekolah ini.Kini nama SRAKD masyhur di kalangan masyarakat yang tinggal di Kota Damansara sebagai satu pusat pengajian agama bagi anak-anak mereka peringkat rendah. SRAKD menjadi tempat rujukan utama bagi masyarakat setempat yang ingin mendapatkan pendidikan agama untuk anak-anak mereka. Semoga sekolah terus berjaya melahirkan insan yang seimbang dan berakhlak mulia demi Agama,Negara dan Bangsa.</div>', NULL, 'Profil', 'On', NULL, ''),
(19, 'MISI,VISI,MOTO', '<h3>MISI SEKOLAH</h3><div><br></div><div>MEMBERIKAN PERKHIDMATAN PENDIDIKAN YANG BERTERASKAN AL QURAN DAN SUNNAH BAGI MELAHIRKAN PELAJAR YANG BERAKHLAK MULIA BERTAQWA DAN BERAMAL SOLEH</div><div><br></div><h3>VISI SEKOLAH</h3><div><br></div><div>MENJADIKAN SRA KOTA DAMANSARA SEBUAH INSTITUSI PENDIDIKAN AGAMA YANG GEMILANG DARI SEGI KURIKULUM DAN KO KURIKULUM SERTA PUSAT PERKEMBANGAN ILMU</div><div><br></div><h3>MOTO SEKOLAH</h3><div><br></div><div>BERILMU, BERAMAL, BERTAQWA DAN BERKHIDMAT</div><div><br></div>', NULL, 'Profil', 'On', NULL, ''),
(20, 'OBJEKTIF & MATLAMAT ', '<div><h3><br>Setelah menerima pendidikan sekurang-kurangnya 6 tahun di SRA Kota Damansara, murid-murid mampu mencapai keputusan cemerlang dalam setiap peperiksaan, menguasai bahasa melayu dan arab, mengamal dan menghayati ilmu fardhu ain dan fardu kifayah, berakhlak mulai, bergiat aktif dalam ko- kurikulum, menyumbang fikiran dan tenaga untk pembangunan dan kemajuan sekolah serta memberi sumbangan yang bermanfaat kepada diri, keluarga,masyarakat agama dan negara</h3></div>', NULL, 'Profil', 'On', NULL, ''),
(21, 'PIAGAM SEKOLAH ', '<div><ol><li>MEMPASTIKAN MURID-MURID DAPAT BELAJAR DENGAN SELESA DAN DIBERIKAN KEMUDAHAN SEWAJARNYA</li><li>MENJADIKAN SEKOLAH SEBAGAI INSTITUSI PERKEMBANGAN ILMU ISLAM YANG DAPAT DIAMALKAN OLEH MURID-MURID DI MANA SAHAJA MEREKA BERADA</li><li>MEMBERIKAN TUNJUK AJAR SERTA BIMBINGAN KEPADA SEMUA MURID BAGI MELAHIRKAN INSAN MUSLIM YANG BERILMU SERTA DAPAT MENGAMALKANNYA DAN MEMPUNYAI KEPERIBADIAN AKHLAK YANG MULIA</li><li>MEWUJUDKAN SUASANA YANG BAIK DAN MESRA &nbsp;DI KALANGAN IBU BAPA PENJAGA DAN MASYARAKAT SETEMPAT&nbsp;</li><li>SENTIASA BERUSAHA MEMPERTINGKATKAN KUALITI PENGAJARAN DAN PEMBELAJARAN DI KALANGAN GURU-GURU</li></ol></div><div><br></div>', NULL, 'Profil', 'On', NULL, ''),
(22, 'FALSAFAH', 'Pendidikan Islam adalah satu usaha berterusan ke arah membina potensi individu berilmu,beriman,beramal,berakhlak mulia dan berketrampilan secara seimbang dan sepadu berlandaskan Wahyu Allah dan Sunnah Rasulullah bagi melahirkan masyarakat muslim yang bertaqwa, maju dan mampu bersaing untuk mendapat kesejahteraan di dunia dan kebahagiaan di akhirat. &nbsp;', NULL, 'Profil', 'On', NULL, ''),
